DROP TABLE IF EXISTS `assets`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `assets` (
  `plaque` varchar(16) NOT NULL,
  `series` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `state` varchar(25) NOT NULL,
  `image` varchar(255) DEFAULT NULL,
  `responsable_id` varchar(15) CHARACTER SET utf8 DEFAULT NULL,
  `assigned_to` varchar(15) CHARACTER SET utf8 DEFAULT NULL,
  `location_id` varchar(255) NOT NULL,
  `sub_location` varchar(255) DEFAULT NULL,
  `year` varchar(4) DEFAULT NULL,
  `lendable` tinyint(1) DEFAULT NULL,
  `observations` longtext,
  `image_dir` varchar(255) DEFAULT NULL,
  `unique_id` varchar(255) DEFAULT NULL,
  `deletable` tinyint(1) NOT NULL,
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `modified` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `residues_id` varchar(200) DEFAULT NULL,
  `deleted` tinyint(1) NOT NULL,
  `loan_id` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `models_id` varchar(255) DEFAULT NULL,
  `brand` varchar(255) DEFAULT NULL,
  `file` varchar(255) DEFAULT NULL,
  `file_dir` varchar(255) DEFAULT NULL,
  `type_id` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`plaque`),
  KEY `fk_owner_id` (`responsable_id`),
  KEY `fk_responsable_id` (`assigned_to`),
  KEY `fk_loans_id` (`loan_id`),
  KEY `fk_models_id` (`models_id`),
  KEY `location_id` (`location_id`),
  KEY `FK_ResiduesToAssets` (`residues_id`),
  KEY `type_id` (`type_id`),
  KEY `FK_BrandsToAssets` (`brand`),
  CONSTRAINT `assets_ibfk_1` FOREIGN KEY (`location_id`) REFERENCES `locations` (`location_id`),
  CONSTRAINT `assets_ibfk_2` FOREIGN KEY (`residues_id`) REFERENCES `residues` (`residues_id`) ON DELETE SET NULL,
  CONSTRAINT `assets_ibfk_3` FOREIGN KEY (`type_id`) REFERENCES `types` (`type_id`),
  CONSTRAINT `fk_loans_id` FOREIGN KEY (`loan_id`) REFERENCES `loans` (`id`),
  CONSTRAINT `fk_models_id` FOREIGN KEY (`models_id`) REFERENCES `models` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
